import React, { useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Box,
  TextField,
  TableSortLabel,
} from '@mui/material';
import { styled } from '@mui/system';
import { LineChart, Line, ResponsiveContainer } from 'recharts';
import { selectFilteredAndSortedAssets, selectSortBy, setSort, setFilter, updateAssets } from '../store/cryptoSlice';
import { WebSocketSimulator } from '../services/mockData';
import { CryptoAsset } from '../types/crypto';

const StyledTableRow = styled(TableRow)(({ theme }) => ({
  '&:nth-of-type(odd)': {
    backgroundColor: theme.palette.action.hover,
  },
}));

const CryptoTable: React.FC = () => {
  const dispatch = useDispatch();
  const assets = useSelector(selectFilteredAndSortedAssets);
  const sortBy = useSelector(selectSortBy);

  useEffect(() => {
    const ws = new WebSocketSimulator();
    const unsubscribe = ws.subscribe((data) => {
      dispatch(updateAssets(data));
    });

    return () => {
      unsubscribe();
    };
  }, [dispatch]);

  const handleSort = (field: keyof CryptoAsset) => {
    const direction = sortBy?.field === field && sortBy.direction === 'asc' ? 'desc' : 'asc';
    dispatch(setSort({ field, direction }));
  };

  const handleFilterChange = (event: React.ChangeEvent<HTMLInputElement>) => {
    dispatch(setFilter(event.target.value));
  };

  return (
    <Box>
      <TextField
        label="Filter by name or symbol"
        variant="outlined"
        onChange={handleFilterChange}
        fullWidth
        margin="normal"
      />
      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>Rank</TableCell>
              <TableCell>Name</TableCell>
              <TableCell>
                <TableSortLabel
                  active={sortBy?.field === 'currentPrice'}
                  direction={sortBy?.field === 'currentPrice' ? sortBy.direction : 'asc'}
                  onClick={() => handleSort('currentPrice')}
                >
                  Price
                </TableSortLabel>
              </TableCell>
              <TableCell>
                <TableSortLabel
                  active={sortBy?.field === 'priceChange24h'}
                  direction={sortBy?.field === 'priceChange24h' ? sortBy.direction : 'asc'}
                  onClick={() => handleSort('priceChange24h')}
                >
                  24h Change
                </TableSortLabel>
              </TableCell>
              <TableCell>Market Cap</TableCell>
              <TableCell>Volume (24h)</TableCell>
              <TableCell>7d Chart</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {assets.map((asset) => (
              <StyledTableRow key={asset.id}>
                <TableCell>{asset.rank}</TableCell>
                <TableCell>
                  <Box display="flex" alignItems="center">
                    <img src={asset.logo} alt={asset.symbol} style={{ width: 24, height: 24, marginRight: 8 }} />
                    {asset.name} ({asset.symbol})
                  </Box>
                </TableCell>
                <TableCell>${asset.currentPrice.toLocaleString()}</TableCell>
                <TableCell style={{ color: asset.priceChange24h >= 0 ? 'green' : 'red' }}>
                  {asset.priceChange24h}%
                </TableCell>
                <TableCell>${asset.marketCap.toLocaleString()}</TableCell>
                <TableCell>${asset.volume24h.toLocaleString()}</TableCell>
                <TableCell style={{ width: 200 }}>
                  <ResponsiveContainer width="100%" height={50}>
                    <LineChart data={asset.chartData.map((value, index) => ({ value }))}>
                      <Line
                        type="monotone"
                        dataKey="value"
                        stroke={asset.priceChange7d >= 0 ? '#4caf50' : '#f44336'}
                        dot={false}
                      />
                    </LineChart>
                  </ResponsiveContainer>
                </TableCell>
              </StyledTableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </Box>
  );
};

export default CryptoTable;
